import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import ItineraryDetails from './pages/ItineraryDetails';  // Make sure you have this page
import AddItinerary from './pages/AddItinerary';
import Login from './pages/Login';
import Signup from './pages/Signup';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/add-itinerary" element={<AddItinerary />} />
        <Route path="/itinerary/:id" element={<ItineraryDetails />} /> {/* Route for details */}
      </Routes>
    </Router>
  );
};

export default App;
